  const [birdiesValue, setBirdiesValue] = React.useState(50);
  const [fairwaysValue, setFairwaysValue] = React.useState(50);
  const [girsValue, setGirsValue] = React.useState(50);

  return (
    <div className="algorithmFormComponentContainer">
      <div className="algorithmForm">
