          <Form.Group>
            <div className="formSelection">
              <Form.Label>Birdies</Form.Label>
              <RangeSlider
                value={value}
                onChange={(e) => setBirdiesValue(e.target.value)}
              />

              value: {birdiesValue}
            </div>

            <div className="formSelection">
              <Form.Label>Fairways</Form.Label>
              <RangeSlider
                value={value}
                onChange={(e) => setFairwaysValue(e.target.value)}
              />
            </div>

            <div className="formSelection">
              <Form.Label>GIRS</Form.Label>
              <RangeSlider
                value={value}
                onChange={(e) => setGirsValue(e.target.value)}
